import jax
import jax.numpy as jnp
from jax import jacfwd, grad


def newton_system(F, x0, tol=1e-12, max_iter=50):
    r"""
    Newton–Raphson for F(x) = 0 where F: C**n → C**m.

    Args:
    - F: function mapping a length-n vector to a length-m vector, $n \geq m$.
    - x0: initial guess, array of shape (n,).
    - tol: convergence tolerance on the step norm.
    - max_iter: maximum number of iterations.

    Returns:
    - Approximate root x (array of shape (n,)).
    - the error norm of every step
    """
    x = x0
    error_norms = []

    for step in range(max_iter):
        F_val = F(x)
        error_norms.append(jnp.linalg.norm(F_val))
        J = jacfwd(F, holomorphic=True)(x)

        dx = jnp.linalg.pinv(J) @ F_val
        x -= dx

        # Check convergence
        if jnp.linalg.norm(F_val) < tol:
            break

        print(step, jnp.linalg.norm(dx), jnp.linalg.norm(F_val))

    return x, error_norms


def gradient_descent(F, x0, alpha=0.01, tol=1e-8, max_iter=10000):
    """
    Gradient descent for minimizing F(x) where F: R**n → R.

    Args:
      F: function mapping a length-n vector to a scalar.
      x0: initial guess, array of shape (n,).
      alpha: learning rate.
      tol: convergence tolerance on the gradient norm.
      max_iter: maximum number of iterations.

    Returns:
      Approximate minimum x (array of shape (n,)).
    """
    x = x0
    for i in range(max_iter):
        grad_F = grad(F, holomorphic=True)(x)

        if jnp.linalg.norm(grad_F) < 1.0:
            grad_F /= jnp.linalg.norm(grad_F)

        x = x - alpha * grad_F

        if jnp.linalg.norm(grad_F) < tol:
            break

    return x


